import './timer.css';
import React  from 'react';
import CountdownTimer from './CoundownTimer'
const Timer = () => {
    return (
        <div className="App">
            <h1>Tiempo restante:</h1> 
         <CountdownTimer
         countdownTimestampMs={1704067200000}/>

            <div className='cards'>
            <h1>:</h1> 
            </div>
        </div>
        
      );
}
export default Timer;
